/****** Object:  View [dbo].[vw_AssetsFullInfo]    Script Date: 07.10.2025 12:48:19 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[vw_AssetsFullInfo] AS
SELECT 
    a.AssetID,
    a.AssetCode,
    a.AssetName,
    a.Description,
    c.CategoryName,
    m.ManufacturerName,
    a.Model,
    a.SerialNumber,
    a.PurchaseDate,
    a.PurchasePrice,
    s.StatusName,
    s.ColorCode AS StatusColor,
    l.LocationName,
    l.Building,
    l.Room,
    CONCAT(e.LastName, ' ', e.FirstName, ' ', e.MiddleName) AS ResponsiblePerson,
    e.Email AS ResponsibleEmail,
    d.DepartmentName AS ResponsibleDepartment,
    CONCAT(creator.LastName, ' ', creator.FirstName) AS CreatedBy,
    a.CreatedDate,
    a.IsActive
FROM Assets a
    INNER JOIN Categories c ON a.CategoryID = c.CategoryID
    LEFT JOIN Manufacturers m ON a.ManufacturerID = m.ManufacturerID
    INNER JOIN AssetStatuses s ON a.StatusID = s.StatusID
    INNER JOIN Locations l ON a.LocationID = l.LocationID
    LEFT JOIN Employees e ON a.ResponsibleEmployeeID = e.EmployeeID
    LEFT JOIN Departments d ON e.DepartmentID = d.DepartmentID
    INNER JOIN Users u ON a.CreatedByUserID = u.UserID
    INNER JOIN Employees creator ON u.EmployeeID = creator.EmployeeID;

