-- Представление для пользователей с полной информацией
CREATE VIEW [dbo].[vw_UsersInfo] AS
SELECT 
    u.UserID,
    u.Username,
    u.IsActive AS UserIsActive,
    u.LastLoginDate,
    r.RoleName,
    e.EmployeeID,
    CONCAT(e.LastName, ' ', e.FirstName, ' ', e.MiddleName) AS FullName,
    e.Email,
    e.Phone,
    p.PositionName,
    d.DepartmentName
FROM Users u
    INNER JOIN UserRoles r ON u.RoleID = r.RoleID
    INNER JOIN Employees e ON u.EmployeeID = e.EmployeeID
    INNER JOIN Positions p ON e.PositionID = p.PositionID
    INNER JOIN Departments d ON e.DepartmentID = d.DepartmentID;

