-- Представление для истории перемещений
CREATE VIEW [dbo].[vw_MovementHistory] AS
SELECT 
    m.MovementID,
    m.MovementDate,
    a.AssetCode,
    a.AssetName,
    fl.LocationName AS FromLocation,
    tl.LocationName AS ToLocation,
    m.Reason,
    CONCAT(e.LastName, ' ', e.FirstName) AS MovedBy
FROM AssetMovements m
    INNER JOIN Assets a ON m.AssetID = a.AssetID
    INNER JOIN Locations fl ON m.FromLocationID = fl.LocationID
    INNER JOIN Locations tl ON m.ToLocationID = tl.LocationID
    INNER JOIN Users u ON m.CreatedByUserID = u.UserID
    INNER JOIN Employees e ON u.EmployeeID = e.EmployeeID
ORDER BY m.MovementDate DESC OFFSET 0 ROWS;

