-- Представление активов по категориям для отчетов
CREATE VIEW [dbo].[vw_AssetsByCategory] AS
SELECT 
    c.CategoryName,
    COUNT(a.AssetID) AS AssetCount,
    SUM(a.PurchasePrice) AS TotalValue,
    AVG(a.PurchasePrice) AS AveragePrice
FROM Categories c
    LEFT JOIN Assets a ON c.CategoryID = a.CategoryID AND a.IsActive = 1
GROUP BY c.CategoryID, c.CategoryName;

GO
