-- Представление активов по отделам
CREATE VIEW [dbo].[vw_AssetsByDepartment] AS
SELECT 
    d.DepartmentName,
    COUNT(a.AssetID) AS AssetCount,
    SUM(a.PurchasePrice) AS TotalValue
FROM Departments d
    LEFT JOIN Employees e ON d.DepartmentID = e.DepartmentID
    LEFT JOIN Assets a ON e.EmployeeID = a.ResponsibleEmployeeID AND a.IsActive = 1
GROUP BY d.DepartmentID, d.DepartmentName;

