-- Хранимая процедура для списания актива
CREATE PROCEDURE [dbo].[sp_DisposeAsset]
    @AssetID INT,
    @DisposalReason NVARCHAR(500),
    @ApprovedByUserID INT,
    @CreatedByUserID INT
AS
BEGIN
    BEGIN TRANSACTION;
    
    -- Проверяем, не списан ли уже актив
    IF NOT EXISTS (SELECT 1 FROM AssetDisposals WHERE AssetID = @AssetID)
    BEGIN
        -- Добавляем запись о списании
        INSERT INTO AssetDisposals (AssetID, DisposalDate, DisposalReason, ApprovedByUserID, CreatedByUserID)
        VALUES (@AssetID, GETDATE(), @DisposalReason, @ApprovedByUserID, @CreatedByUserID);
        
        -- Обновляем статус актива на "Списан"
        UPDATE Assets 
        SET StatusID = 4, -- ID статуса "Списан"
            IsActive = 0,
            ModifiedDate = GETDATE(),
            ModifiedByUserID = @CreatedByUserID
        WHERE AssetID = @AssetID;
    END
    
    COMMIT TRANSACTION;
END;

