-- Хранимая процедура для перемещения актива
CREATE PROCEDURE [dbo].[sp_MoveAsset]
    @AssetID INT,
    @NewLocationID INT,
    @Reason NVARCHAR(500),
    @UserID INT
AS
BEGIN
    BEGIN TRANSACTION;
    
    DECLARE @OldLocationID INT;
    
    -- Получаем текущую локацию
    SELECT @OldLocationID = LocationID FROM Assets WHERE AssetID = @AssetID;
    
    -- Проверяем, что локация действительно изменилась
    IF @OldLocationID != @NewLocationID
    BEGIN
        -- Записываем перемещение
        INSERT INTO AssetMovements (AssetID, FromLocationID, ToLocationID, Reason, CreatedByUserID)
        VALUES (@AssetID, @OldLocationID, @NewLocationID, @Reason, @UserID);
        
        -- Обновляем локацию актива
        UPDATE Assets 
        SET LocationID = @NewLocationID,
            ModifiedDate = GETDATE(),
            ModifiedByUserID = @UserID
        WHERE AssetID = @AssetID;
    END
    
    COMMIT TRANSACTION;
END;

