-- Создаем процедуру для обновления статистики
CREATE PROCEDURE [dbo].[sp_UpdateDashboardStats]
AS
BEGIN
    UPDATE DashboardStats
    SET TotalAssets = (SELECT COUNT(*) FROM Assets WHERE IsActive = 1),
        ActiveAssets = (SELECT COUNT(*) FROM Assets WHERE StatusID = 1 AND IsActive = 1),
        InStorageAssets = (SELECT COUNT(*) FROM Assets WHERE StatusID = 2 AND IsActive = 1),
        InRepairAssets = (SELECT COUNT(*) FROM Assets WHERE StatusID = 3 AND IsActive = 1),
        DisposedAssets = (SELECT COUNT(*) FROM Assets WHERE StatusID = 4),
        TotalValue = (SELECT ISNULL(SUM(PurchasePrice), 0) FROM Assets WHERE IsActive = 1),
        MovementsThisMonth = (SELECT COUNT(*) FROM AssetMovements WHERE MONTH(MovementDate) = MONTH(GETDATE()) AND YEAR(MovementDate) = YEAR(GETDATE())),
        MaintenanceThisMonth = (SELECT COUNT(*) FROM Maintenance WHERE MONTH(MaintenanceDate) = MONTH(GETDATE()) AND YEAR(MaintenanceDate) = YEAR(GETDATE())),
        LastUpdated = GETDATE()
    WHERE StatsID = 1;
END;
